#sundayshowcase hosted by L.A. Foodies Anonymous members @30daysoftakeout @lenazilla: With @passthetums 

Now that  #dtlaisopen we can finally start being a #socialclub again and what better way to celebrate our first #socialevent than a #pizzaparty! However this wasn’t no ordinary pizza party, we had 2 restaurants who for one night made custom pizzas for the L.A. Foodies Anonymous Community! 

@tbla_caters and @zfalafel8 both made a special variation fusing together their incredible cultural ingredients onto the delicious pizzas @pizzasocialela for a exclusive collaboration event for us only! 

Check out the video and see the entire night of fun! Keep up with us because there’s definitely going to be more outings to follow soon. 
