L.A. Foodies Anonymous member @30daysoftakeout previews a hot new popup in KoreaTown @fishpop.la and speaks with owner and head chef Joon as he discusses his love for cooking, what goes into making his fish flavor something you’ll definitely want to enjoy, what his future goals are, and  what’s been working for him despite the current Calamity of COVID-19. 

